        shouldShowVariant: function () {
            var uuid = apiService.getUserUUID();
            if (uuid) {
                var hex = uuid.slice(-1);
                var int = parseInt(hex, 16); // parse hexadecimal string
                return int % 2;
            } else {
                return false;
            }
        },
